
# inventory example data files
files <- list.files("inst/extdata",
                    pattern = glue::glue("^template.*\\.csv$"),
                    full.names = TRUE)


# map over files to create a list, reading in the file and keeping the column headers only
input_templates <- purrr::map(files,
~ readr::read_csv(.x, n_max = 0) |>
  janitor::clean_names() |>
  names())


# name each element of the list based on the file name
names(input_templates) <- basename(files)  |>
  stringr::str_replace("template", "parse_sisma") |>
  stringr::str_remove(".csv")


